import React from "react";
import Navbar from './Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Create from './CreateUser';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="content">
          <Switch>
            <Route path="/create" component={Create} />
            {/* Other routes */}
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
